58b5e7a\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. What are Mira's healthy habits? What are her unhealthy habits?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"a7abdc01-b978-45cb-9f5f-9b75b8fb006e\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. What advice do you give each to stay fit and have healthy muscles?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"62ff110c-c263-4f6a-ab45-afb5a3074efa\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"A Healthy Lifestyle\",\"authors\":[],\"changes\":[],\"extraTitle\":\"A Healthy Lifestyle\"},\"subContentId\":\"8de3b50b-21c1-4178-ae89-d9088a8d87ba\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Karim's healthy habits: He walks, swims, and bikes regularly.</p>\\n\\n<p>     Karim's unhealthy habits: He eats unhealthy food.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"64b6eafb-92fb-4e12-9f03-74dff5798842\"},{\"params\":{\"text\":\"<p>2. Mira's healthy habits: She eats healthy, balanced meals and drinks milk.</p>\\n\\n<p>     Mira's unhealthy habits: She drinks soda instead of water, and she hardly ever exercises.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7c36eec6-bf9c-4219-b140-aff9029ada4c\"},{\"params\":{\"text\":\"<p>3. I would advise Karim to eat more balanced meals rich in proteins (meat, fish, chicken, eggs...), while I would advise Mira to exercise more often and drink water instead of soda.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9e84f996-8036-455a-87c4-54e6cdecd934\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Click here for your answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click here for your answers\"},\"subContentId\":\"fadc25ce-10ca-4450-a9ef-d7494aa5f5e7\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"deca4721-d0f2-4f1a-a476-7fdd6a582c6d\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 2</strong></h3>\\n\\n<p> Observe carefully the animated image below. Then, answer the questions that follow. </p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5bfdf48b-aa43-4e75-8ad5-141d6eb8c3d9\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/gif;base64,R0lGODlh6APtAPcAAAAAAP////LMj8qreSo7jgCG/zc2OAICGQIFJSIjLyo2jC46jy46igIJMSY2jSUyehskVio2hDI/jwMNQio6jiY2gCo6iiMxdB4pYio6hiIubC4+ji4+ijhIl0xbol1qqnJ9tYWPv5aeyCY6jiY4hhUfSis+kio+jjFDkj9QmwMJHwwcWBAbPg4TJCotNRYcKwUjZjE3QwoaNQIzfgYXMAJHmQISJgoaLAI1awIWKgISIgYWJgKC/gKG/gKC+gKC9QJ99AJ+7gJ55AaG/gqK/gqG+Qt+5w6K/g6F8hCK+ROO/hiG6BqI8R6T/iyb/jui/kOm/lWKugKK/gKG+gKC7gJ22gJw0 },\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"32ef7f43-0a30-4afe-a252-9699be4383b9\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"A Model of Movement\",\"authors\":[],\"changes\":[],\"extraTitle\":\"A Model of Movement\"},\"subContentId\":\"b232d15e-659f-4385-b174-8c0e5e55e085\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. The pieces of wood represent the bones. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"777c9bb3-0ef3-4de1-9349-a9086064ed36\"},{\"params\":{\"text\":\"<p>2. The blue piece of elastic represents the muscles. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"50637360-402d-4c84-998d-90c26022a51d\"},{\"params\":{\"text\":\"<p>3. By contracting, the muscle shortens and thickens (the blue elastic) and pulls on the bone to which it is attached (the piece of wood) causing its movement.  </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"d950f4ee-0cde-435d-a182-2a6055afa146\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Click for your answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Click for your answers\"},\"subContentId\":\"e6c086b7-36a6-44a4-8241-d1a071294124\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":
